import React, {Component} from 'react';
import {Link} from "react-router-dom";

class Order extends Component {
    render() {
        const { id, username, datePlaced, items, isShipped, shippingCarrier, trackingNumber } = this.props.order;
        return (
            <div className='col-md-12'>
                <div className="card mb-4 shadow-sm">
                    <div className="card-body">
                        <h3><strong>Order {id}</strong></h3>
                        <p className="card-text">Placed by: {username}</p>
                        <p className="card-text">Date: ${datePlaced}</p>
                        {/*<button className="btn btn-dark m-1" onClick={this.addToCart.bind(this, this.props.item)}>Add to cart</button>*/}
                    </div>
                </div>
            </div>
        );
    }
}

export default Order;
